import './bookingForm.css';

const BookingForm = () => {
  return (
    <div className="booking">
      <form>
        <div className="bookingInputContainer">
          <label htmlFor="Name">Name: </label>
          <input type="text" placeholder="Enter something" />
        </div>
        <button>Submit</button>
      </form>
    </div>
  );
};

export default BookingForm;
